import React, { useState, useEffect } from 'react';
import Dashboard from './components/Dashboard'; // Tableau de bord existant
import FinancialModule from './components/FinancialModule'; // Exemple de module financier
import Login from './components/auth/Login'; // Formulaire de connexion
import Signup from './components/auth/Signup'; // Formulaire d'inscription
import { useAuth } from './context/AuthContext'; // Contexte d'authentification

function App() {
  const { auth, login, logout, signup } = useAuth(); // Récupère les fonctions du contexte
  const [activeTab, setActiveTab] = useState('dashboard'); // Gestion des onglets actifs
  const [showSignup, setShowSignup] = useState(false); // Basculer entre Login et Signup

  // États pour la gestion des données
  const [formData, setFormData] = useState({
    shipName: '',
    shipType: '',
    status: 'navigation',
    activity: '',
    equipmentName: '',
    workingStartTime: '',
    workingStopTime: '',
    remarks: '',
  });

  const [records, setRecords] = useState([]);
  const [equipmentHours, setEquipmentHours] = useState({});
  const [maintenanceAlerts, setMaintenanceAlerts] = useState([]);

  // Si l'utilisateur n'est pas connecté, affiche Login ou Signup
  if (!auth) {
    return showSignup ? (
      <Signup
        onSignup={(userData) => {
          signup(userData); // Enregistre un nouvel utilisateur
          setShowSignup(false); // Retourne à l'écran de connexion
        }}
      />
    ) : (
      <Login
        onLogin={login} // Connecte l'utilisateur
        onSignup={() => setShowSignup(true)} // Passe à l'écran d'inscription
      />
    );
  }

  // Gérer la soumission des formulaires ou les opérations
  const handleSubmit = (e) => {
    e.preventDefault();
    const workingHours = calculateWorkingHours(
      formData.workingStartTime,
      formData.workingStopTime
    );

    // Met à jour les données des équipements et des alertes
    updateEquipmentHours(formData.equipmentName, workingHours);
    const newRecord = {
      id: Date.now(),
      ...formData,
      workingHours,
      dateAdded: new Date().toLocaleString(),
    };

    setRecords((prev) => [...prev, newRecord]);

    // Vérifie les alertes de maintenance
    const totalHours = (equipmentHours[formData.equipmentName] || 0) + workingHours;
    const maintenanceNeeded = checkMaintenance(formData.equipmentName, totalHours);
    if (maintenanceNeeded.length > 0) {
      setMaintenanceAlerts((prev) => [...prev, ...maintenanceNeeded]);
    }

    // Réinitialise le formulaire
    setFormData({
      shipName: '',
      shipType: '',
      status: 'navigation',
      activity: '',
      equipmentName: '',
      workingStartTime: '',
      workingStopTime: '',
      remarks: '',
    });
  };

  const calculateWorkingHours = (startTime, stopTime) => {
    const start = new Date(startTime);
    const stop = new Date(stopTime);
    return (stop - start) / (1000 * 60 * 60);
  };

  const updateEquipmentHours = (equipmentName, hours) => {
    setEquipmentHours((prev) => ({
      ...prev,
      [equipmentName]: (prev[equipmentName] || 0) + hours,
    }));
  };

  const checkMaintenance = (equipmentName, totalHours) => {
    // Exemple de logique pour vérifier les maintenances
    return [];
  };

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Header avec navigation */}
      <header className="bg-white shadow">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex justify-between h-16">
            <h1 className="text-xl font-bold text-gray-900">Marine Equipment Management</h1>
            <div className="flex items-center space-x-4">
              <span>Welcome, {auth.user}!</span>
              <button
                onClick={logout}
                className="px-4 py-2 bg-red-600 text-white rounded hover:bg-red-700"
              >
                Logout
              </button>
            </div>
          </div>
        </div>
      </header>

      {/* Navigation des onglets */}
      <nav className="bg-gray-100 py-4">
        <div className="max-w-7xl mx-auto flex space-x-4">
          <button
            onClick={() => setActiveTab('dashboard')}
            className={`px-4 py-2 rounded ${
              activeTab === 'dashboard' ? 'bg-blue-500 text-white' : 'bg-white'
            }`}
          >
            Dashboard
          </button>
          <button
            onClick={() => setActiveTab('financial')}
            className={`px-4 py-2 rounded ${
              activeTab === 'financial' ? 'bg-blue-500 text-white' : 'bg-white'
            }`}
          >
            Financial
          </button>
        </div>
      </nav>

      {/* Contenu principal */}
      <main className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
        {activeTab === 'dashboard' && (
          <Dashboard
            records={records}
            equipmentHours={equipmentHours}
            maintenanceAlerts={maintenanceAlerts}
          />
        )}
        {activeTab === 'financial' && (
          <FinancialModule
            records={records}
            equipmentHours={equipmentHours}
            maintenanceAlerts={maintenanceAlerts}
          />
        )}
      </main>
    </div>
  );
}

export default App;
